var date = new Date().toLocaleDateString()
var time = new Date().toLocaleTimeString()
ReactDom.render(
    <>
    <h1>Hello , My name is {name}</h1>
    <p>Date : {date} </p>
    <p>Time : {time} </p>
    </>,document.getElementById("root")
);
